// src/components/FrontPage.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './FrontPage.css';

function FrontPage() {
  const navigate = useNavigate();

  return (
    <div className="front-page">
      {/* Logo */}
      <header className="header">
        <img src="/logo.png" alt="CSECU Logo" className="logo" />
      </header>

      {/* Welcome Section */}
      <div className="content">
        <h1 className="welcome-message">Welcome to the CSECU Family</h1>
        <p className="description">
          The Department of Computer Science & Engineering (CSE) at the University of Chittagong launched its undergraduate major programme in 2001 and its postgraduate programme in 2010. CSE department currently hosts 22 faculty members, including eight Professors and around 400 students. There are 300 undergraduate students, 100 MSc students, and a few postgraduate research students in a very cooperative and friendly environment. üåê üßë‚Äçüíª üìö
        </p>
        <div className="button-group">
          <button className="btn" onClick={() => navigate('/signup')}>
            Sign Up
          </button>
          <button className="btn" onClick={() => navigate('/login')}>
            Login
          </button>
        </div>
      </div>

      {/* Background Animation */}
      <div className="background-animation">
        <div className="circle"></div>
        <div className="circle"></div>
        <div className="circle"></div>
      </div>
    </div>
  );
}

export default FrontPage;
